import React from 'react';
import marcLogo from './marcLogo.png';
import './Navigation.css';

const Navigation = () => {

	return (
		<div>
			<ul className='navBar'>
				<li className='logo'><a><img className='marcLogo' alt='marcLogo' src={marcLogo}/></a></li>
        <li><p>About</p></li>
        <li><p>Contact</p></li>
			</ul>
		</div>
	);
};

export default Navigation;
